import React from 'react';
import AppNavbar from './components/AppNavbar'
import ShoppingList from './components/ShoppingList'
import Sidebar from './components/Sidebar'

import 'bootstrap/dist/css/bootstrap.min.css'
import './App.css';

function App() {
  return (
    <div className="App">
      <Sidebar/>
      <AppNavbar/>
      <ShoppingList/>
    </div>
  );
}

export default App;
